// src/components/HomePage.js
import React from 'react';
import { Container, Button, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../assets/c/CustomStyles.css';

const HomePage = () => {
  return (
    <Container className="home-page text-center mt-5">
      <h1 className="mb-4">Welcome to School Attendance System</h1>
      <p>Efficient and secure attendance management using facial recognition.</p>
      <Row className="mt-5">
        <Col>
          <Link to="/enroll">
            <Button variant="primary" className="custom-button">Enroll Now</Button>
          </Link>
        </Col>
        <Col>
          <Link to="/login">
            <Button variant="secondary" className="custom-button">Login</Button>
          </Link>
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
